    true,nt"url": null,nt"notes": "Education Demographic and Geographic Estimates,
    SY 2013-14 (EDGE SY 2013-14), is a data resource of the Education Demographic and
    Geographic Estimates program; program data is available since SY 1989-1990 at <http://nces.ed.gov/programs/edge/geographicDistrictBoundary.aspx>.
    EDGE SY 2013-14 (http://nces.ed.gov/programs/edge/default.aspx) uses data from the
    U.S. Census Bureauu2019s American Community Survey to create custom indicators of
    social, economic, and housing conditions for school-age children and their parents.
    It also uses spatial data collected by NCES and the Census Bureau to create geographic
    locale indicators, school point locations, school district boundaries, and other
